import{_ as a,c as e,o as t,a as o}from"./app.7b40abf5.js";const v=JSON.parse('{"title":"\u7B2C\u4E00\u90E8\u5206","description":"","frontmatter":{},"headers":[],"relativePath":"Interview/JavaScript/part01.md","lastUpdated":1668855793000}'),s={name:"Interview/JavaScript/part01.md"},c=o(`<h1 id="\u7B2C\u4E00\u90E8\u5206" tabindex="-1">\u7B2C\u4E00\u90E8\u5206 <a class="header-anchor" href="#\u7B2C\u4E00\u90E8\u5206" aria-hidden="true">#</a></h1><h2 id="async-await-\u662F\u4EC0\u4E48\uFF1F\u5B83\u6709\u54EA\u4E9B\u4F5C\u7528\uFF1F" tabindex="-1">async await \u662F\u4EC0\u4E48\uFF1F\u5B83\u6709\u54EA\u4E9B\u4F5C\u7528\uFF1F <a class="header-anchor" href="#async-await-\u662F\u4EC0\u4E48\uFF1F\u5B83\u6709\u54EA\u4E9B\u4F5C\u7528\uFF1F" aria-hidden="true">#</a></h2><div class="info custom-block"><p class="custom-block-title">\u6269\u5C55\u95EE\u9898</p><ul><li>\u4F60\u600E\u4E48\u770B\u201D \u56DE\u8C03\u5730\u72F1 \u201C\u95EE\u9898\uFF1F\u600E\u4E48\u89E3\u51B3\uFF1F\u4E3A\u4EC0\u4E48\uFF1F</li><li>async await \u6709\u54EA\u4E9B\u4F18\u70B9\u548C\u7F3A\u9677\uFF1F</li><li>await/async \u7684\u539F\u7406\u662F\u4EC0\u4E48\uFF1F</li></ul></div><p>async await \u662F es7 \u91CC\u9762\u7684\u65B0\u8BED\u6CD5\uFF0C\u5B83\u7684\u4F5C\u7528\u5C31\u662F async \u7528\u4E8E\u58F0\u660E\u4E00\u4E2A function \u662F\u5F02\u6B65\u7684\uFF0C\u800C await \u7528\u4E8E\u7B49\u5F85\u4E00\u4E2A\u5F02\u6B65\u65B9\u6CD5\u6267\u884C\u5B8C\u6210\u3002\u5B83\u53EF\u4EE5\u5F88\u597D\u7684\u66FF\u4EE3 promise \u4E2D\u7684 then\u3002</p><p>async \u51FD\u6570\u8FD4\u56DE\u4E00\u4E2A Promise \u5BF9\u8C61\uFF0C\u53EF\u4EE5\u4F7F\u7528 then \u65B9\u6CD5\u6DFB\u52A0\u56DE\u8C03\u51FD\u6570\u3002\u5F53\u51FD\u6570\u6267\u884C\u7684\u65F6\u5019\uFF0C\u4E00\u65E6\u9047\u5230 await \u5C31\u4F1A\u5148\u8FD4\u56DE\uFF0C\u7B49\u5230\u5F02\u6B65\u64CD\u4F5C\u5B8C\u6210\uFF0C\u518D\u63A5\u7740\u6267\u884C\u51FD\u6570\u4F53\u5185\u540E\u9762\u7684\u8BED\u53E5\u3002</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>async \u548C await \u5BF9\u4E8E\u89E3\u51B3\u201D \u56DE\u8C03\u5730\u72F1 \u201C\u95EE\u9898\u5341\u5206\u6709\u6548\uFF0C\u5176\u672C\u8D28\u662F Promise \u7684\u8BED\u6CD5\u7CD6\u3002\u4F46\u662F\u5176\u672C\u8EAB\u4E5F\u5B58\u5728\u4E00\u4E9B\u95EE\u9898\uFF0C\u4E00\u79CD\u5C31\u662F <code>await</code> \u548C <code>async</code> \u7684\u8FDE\u7EED\u4F20\u64AD\u95EE\u9898\uFF0C\u539F\u56E0\u662F <code>await</code> \u53EA\u80FD\u7528\u5728 <code>async</code> \u51FD\u6570\u4E2D\uFF1B\u53E6\u5916\u4E00\u79CD\u5C31\u662F\u9876\u5C42 <code>await</code> \u95EE\u9898\uFF08\u7834\u574F\u4E86\u524D\u8FF0\u7684\u89C4\u5219\uFF09\uFF0C\u8FD9\u79CD\u95EE\u9898\u76EE\u524D\u5DF2\u7ECF\u88AB\u89E3\u51B3\uFF0C\u53C2\u89C1<a href="https://stackoverflow.com/questions/46515764/how-can-i-use-async-await-at-the-top-level" target="_blank" rel="noreferrer"> javascript - How can I use async/await at the top level? - Stack Overflow</a>\u3002</p><blockquote><p>The await operator is used to wait for a Promise and get its fulfillment value. It can only be used inside an async function or <strong>at the top level of a module</strong>. \u53C2\u89C1<a href="https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Operators/await#top_level_await" target="_blank" rel="noreferrer"> await - JavaScript | MDN</a>\u3002</p></blockquote><p>\u53E6\u5916\u9700\u8981\u6CE8\u610F\u7684\u662F\uFF0Casync/await \u5E76\u4E0D\u662F\u7528\u6765\u66FF\u4EE3 Promise \u7684\u3002\u8BF7\u6CE8\u610F\uFF0C\u53EA\u5728\u9002\u5F53\u7684\u573A\u5408\u4F7F\u7528\u5B83\uFF0C\u56E0\u4E3A\u5B83\u4F1A\u963B\u585E\u51FD\u6570\u4E2D\u5176\u4F59\u90E8\u5206\u4EE3\u7801\u7684\u6267\u884C\uFF0C\u4F7F\u51FD\u6570\u7684\u6267\u884C\u6548\u679C\u53D8\u4E3A\u7C7B\u4F3C\u4E8E\u540C\u6B65\u6267\u884C\u3002\u5BF9 async/await \u7684\u8FC7\u5206\u4F9D\u8D56\uFF08\u6E90\u4E8E async/await \u7684\u4F20\u64AD\u6027\uFF09\u4F1A\u727A\u7272\u6389 Promise \u5F02\u6B65\u7684\u7279\u6027\uFF0C\u662F\u7A0B\u5E8F\u4E22\u5931\u6389\u5F02\u6B65\u7684\u9AD8\u6548\uFF0C\u964D\u4F4E\u7A0B\u5E8F\u7684\u6267\u884C\u6548\u7387\u3002\u6700\u4E3A\u9700\u8981\u6CE8\u610F\u7684\u4E00\u4E2A\u95EE\u9898\u4FBF\u662F\uFF0C\u4E0D\u8BE5 <code>await</code> \u7684\u65B9\u6CD5\u5C31\u4E0D\u8981 <code>await</code> \u3002</p></div><div class="tip custom-block"><p class="custom-block-title">await/async \u7684\u539F\u7406</p><p><code>async/await</code> \u6700\u9C9C\u660E\u7684\u7279\u70B9\u5C31\u662F\uFF1A\u5728 <code>async</code> \u51FD\u6570\u4E2D\uFF0C <code>await</code> \u4F7F\u5F97\u51FD\u6570\u6709\u4E86\u201D \u6682\u505C \u201C\u548C\u201D \u7EE7\u7EED \u201C\u7684\u610F\u5473\u3002\u8FD9\u6070\u6070\u662F\u751F\u6210\u5668\u7684\u7279\u70B9\uFF0C\u53EA\u662F\u751F\u6210\u5668\u8981\u66F4\u52A0\u7684\u5F3A\u5927\u3002 <code>async/await</code> \u4E3A\u4EC0\u4E48\u4F1A\u6709\u8FD9\u6837\u7684\u7279\u70B9\u5462\uFF1F\u5176\u539F\u7406\u8FD8\u662F Promise\u3002</p><p>\u5728 <code>async</code> \u51FD\u6570\u4E2D\uFF0C\u4E3B\u7EBF\u7A0B\u5728\u9047\u5230 <code>await</code> \u4E4B\u540E\uFF0C\u4F1A\u5C06 <code>await</code> \u7684\u4EFB\u52A1\u548C\u8BE5\u51FD\u6570\u4E2D\u5269\u4F59\u7684\u90E8\u5206\u5305\u88C5\u4E3A\u4E00\u4E2A Promise\uFF0C\u5E76\u5C06\u8FD9\u4E2A Promise \u63A8\u5165\u5230\u5FAE\u4EFB\u52A1\u961F\u5217\u4E2D\uFF0C\u7136\u540E\u4E3B\u7EBF\u7A0B\u5C31\u4ECE\u8BE5 <code>async</code> \u51FD\u6570\u4E2D\u8FD4\u56DE\u4E86\uFF0C\u7EE7\u7EED\u6267\u884C\u5269\u4F59\u7684\u4EE3\u7801\u3002\u5F53\u7A0B\u5E8F\u5806\u6808\u4E3A\u7A7A\u65F6\uFF08\u4E3B\u7EBF\u7A0B\u7A7A\u95F2\uFF09\uFF0C\u4E3B\u7EBF\u7A0B\u4F1A\u4ECE\u5FAE\u4EFB\u52A1\u961F\u5217\u4E2D\u53D6\u51FA\u524D\u8FF0\u7684 Promise \u4EFB\u52A1\u8FDB\u884C\u6267\u884C\uFF08\u524D\u63D0\u662F\u8BE5 Promise \u4E0D\u662F pending \u72B6\u6001\uFF0C\u5373 <code>await</code> \u7684\u4EFB\u52A1\u5DF2\u7ECF\u5B8C\u6210\uFF0C\u5426\u5219\u5C31\u63A8\u8FDF\u5230\u4E0B\u4E00\u6B21\u4E3B\u7EBF\u7A0B\u56DE\u8C03\uFF09\u3002\u7531\u6B64\u53EF\u89C1 <code>await</code> \u4E4B\u524D\u7684\u4EE3\u7801\u7684\u6267\u884C\u884C\u4E3A\u662F\u6B63\u5E38\u7684\uFF0C\u800C\u540E\u7EED\u7684\u6267\u884C\u5176\u5B9E\u662F Promise \u7684\u518D\u5305\u88C5\uFF0C <code>async/await</code> \u5B9E\u9645\u4E0A\u662F Promise \u7684\u8BED\u6CD5\u7CD6\u3002\u8BE6\u89C1<a href="/WEB/\u56FE\u89E3JavaScript/04-Promises\u548CAsync&amp;Await#async-await">\u56FE\u89E3 JavaScript \u4E4B Promises \u548C Async/Await</a>\u3002</p><p>Promise \u624D\u5E94\u8BE5\u662F\u4E3B\u89D2\u3002\u201D \u56DE\u8C03\u5730\u72F1 \u201C\u56FA\u7136\u662F\u95EE\u9898\uFF0C\u4F46\u662F\u8FD9\u4E0D\u5E94\u8BE5\u662F\u201D \u56DE\u8C03 \u201C\u7684\u9505\u3002\u201D \u56DE\u8C03 \u201C\u5728\u5F88\u5927\u7A0B\u5EA6\u4E0A\u63D0\u5347\u4E86 JavaScript \u7684\u751F\u4EA7\u529B\uFF0C\u540C\u65F6\u4E5F\u662F\u51FD\u6570\u5F0F\u7F16\u7A0B\u4E00\u5927\u5229\u5668\u3002\u6211\u4EEC\u5E94\u8BE5\u5145\u5206\u53D1\u6325 Promise \u7684\u6548\u7387\uFF0C\u5229\u7528\u597D\u4E8B\u4EF6\u5FAA\u73AF\u548C\u5FAE\u4EFB\u52A1\uFF0C\u5728\u8FD9\u4E2A\u65B9\u9762\uFF0C <code>single-spa</code> \u7ED9\u6211\u4EEC\u63D0\u4F9B\u4E86\u5F88\u597D\u7684\u8303\u4F8B\uFF0C\u53C2\u89C1<a href="https://source.jonsam.site/slides/#/3" target="_blank" rel="noreferrer">\u5FAE\u524D\u7AEF\u57FA\u7840\u4E0E single-spa \u521D\u63A2</a>\u3002</p></div><h2 id="\u5E38\u7528\u7684\u6570\u7EC4\u65B9\u6CD5\u6709\u54EA\u4E9B\uFF1F" tabindex="-1">\u5E38\u7528\u7684\u6570\u7EC4\u65B9\u6CD5\u6709\u54EA\u4E9B\uFF1F <a class="header-anchor" href="#\u5E38\u7528\u7684\u6570\u7EC4\u65B9\u6CD5\u6709\u54EA\u4E9B\uFF1F" aria-hidden="true">#</a></h2><div class="info custom-block"><p class="custom-block-title">\u6269\u5C55\u95EE\u9898</p><ul><li>JavaScript \u4E2D\u6570\u7EC4\u662F\u4EC0\u4E48\u539F\u7406\uFF1F</li><li>JavaScript \u4E2D\u7684\u6570\u7EC4\u4E3A\u4EC0\u4E48\u80FD\u591F\u81EA\u52A8\u6269\u5BB9\uFF1F\u5177\u4F53\u662F\u600E\u4E48\u81EA\u52A8\u6269\u5BB9\u7684\uFF1F</li><li>JavaScript \u4E2D\u7684\u6570\u7EC4\u662F\u4EE5\u600E\u6837\u7684\u6570\u636E\u7ED3\u6784\u50A8\u5B58\u7684\uFF1F</li><li>\u600E\u4E48\u6837\u63D0\u5347\u6570\u7EC4\u7684\u5B58\u53D6\u6548\u7387\uFF1F\u4E3A\u4EC0\u4E48\uFF1F</li><li>JavaScript \u4E2D\u7684\u6570\u7EC4\u662F\u5982\u4F55\u5B58\u53D6\u7684\uFF1F</li><li>\u804A\u4E00\u804A\u4F60\u5BF9 JavaScript \u7684\u6570\u7EC4\u7684\u7406\u89E3\uFF0C\u5B83\u7684\u9AD8\u6548\u4F53\u73B0\u5728\u54EA\uFF1F\u6709\u54EA\u4E9B\u7F3A\u9677\uFF1F</li><li>JavaScript \u6570\u7EC4\u4E2D\u67D0\u4E2A\u6570\u7EC4\u65B9\u6CD5\u7684\u539F\u7406\u662F\u4EC0\u4E48\uFF1F</li></ul></div><p>\u5E38\u7528\u7684\u6570\u7EC4\u65B9\u6CD5\uFF0C\u7565\u3002\u53C2\u89C1\uFF1A<a href="https://developer.mozilla.org/zh-CN/docs/Web/JavaScript/Reference/Global_Objects/Array#%E6%8F%8F%E8%BF%B0" target="_blank" rel="noreferrer">Array - JavaScript | MDN</a>\u3002</p><div class="tip custom-block"><p class="custom-block-title">JavaScript \u4E2D\u6570\u7EC4\u7684\u539F\u7406</p><p>JavaScript \u4E2D\u7684\u6570\u7EC4\u548C\u7F16\u8BD1\u578B\u8BED\u8A00\uFF0C\u5982 Java\u3001C++ \u4E2D\u7684\u6570\u7EC4\u5B8C\u5168\u4E0D\u662F\u540C\u4E00\u4E2A\u6982\u5FF5\u3002JavaScript \u4E2D\u7684\u6570\u7EC4\u662F\u4E00\u4E2A\u53CA\u5176\u590D\u6742\u7684\u6570\u636E\u7ED3\u6784\uFF0C\u5176\u672C\u8D28\u662F Object\u3002\u5982\u4E0B\uFF1A</p><div class="language-js line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang">js</span><pre class="shiki"><code><span class="line"><span style="color:#FFCB6B;">Array</span><span style="color:#89DDFF;">.</span><span style="color:#A6ACCD;">prototype</span><span style="color:#89DDFF;">.</span><span style="color:#A6ACCD;">__proto__ </span><span style="color:#89DDFF;">===</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">Object</span><span style="color:#89DDFF;">.</span><span style="color:#A6ACCD;">prototype </span><span style="color:#676E95;">// true</span></span>
<span class="line"></span></code></pre><div class="line-numbers-wrapper"><span class="line-number">1</span><br></div></div><p><img data-zooming src="https://cdn.staticaly.com/gh/jonsam-ng/image-hosting@master/2022/image.396b9fg46vw0.webp" alt="image" data-src="https://cdn.staticaly.com/gh/jonsam-ng/image-hosting@master/2022/image.396b9fg46vw0.webp"></p><p>\u6570\u7EC4\u5728 V8 \u4E2D\u662F <code>FixedArray</code> \uFF0C\u6570\u7EC4\u5143\u7D20\u79F0\u4E4B\u4E3A <code>element</code> \u3002\u5728 <code>Object</code> \u4E2D\uFF0C\u5BF9\u8C61\u7684\u5C5E\u6027\u5FC5\u987B\u662F String\uFF0C\u5982\u679C\u4E0D\u662F String \u9700\u8981\u8F6C\u5316\u4E3A String\u3002Number \u548C Symbol \u5728\u4F5C\u4E3A\u5C5E\u6027\u65F6\u4FBF\u662F\u5982\u6B64\u3002\u7531\u6B64\uFF0C\u5982\u679C\u5C5E\u6027\u662F\u53EF\u4EE5\u8F6C\u6210\u6570\u7EC4\u7684\uFF0C\u5982\u6570\u5B57 1 \u6216\u8005\u5B57\u7B26 <code>1</code> \uFF0C\u5219\u5B58\u4E3A Element\uFF0C\u5426\u5219\u5C31\u5B58\u4E3A Property\u3002Properties \u4EE5\u975E\u8FDE\u7EED\u5185\u5B58\u50A8\u5B58\uFF0C\u56E0\u6B64\u4E0D\u53EF\u4EE5\u4E0B\u6807\u53D6\u503C\uFF1BElements \u4EE5\u8FDE\u7EED\u5185\u5B58\u50A8\u5B58\uFF0C\u56E0\u6B64\u53EF\u4EE5\u4E0B\u6807\u53D6\u503C\u3002\u53E6\u5916 Elements \u6709 length \u5C5E\u6027\u3002\u56E0\u6B64\uFF0CArray \u7684\u672C\u8D28\u662F Object\uFF0C\u540C\u65F6 Array \u7EE7\u627F\uFF08\u539F\u578B\u94FE\u7EE7\u627F\u4E0D\u540C\u4E8E\u4F20\u7EDF\u7EE7\u627F\uFF0C\u6B64\u5904\u6307\u7684\u662F Object \u5728 Array \u539F\u578B\u94FE\u7684\u4E0A\u6E38\uFF09\u81EA Object\u3002</p><p>Array \u7684\u6570\u636E\u7ED3\u6784\uFF1A</p><p>\u6211\u4EEC\u53EF\u80FD\u6CE8\u610F\u5230\u4E86 JavaScript \u4E2D\u7684 Array \u548C\u4F20\u7EDF Array \u76F8\u6BD4\u5177\u6709\u5982\u4E0B\u795E\u5947\u7684\u7279\u6027\uFF1A</p><ul><li>\u4E0D\u9700\u8981\u521D\u59CB\u5316\u957F\u5EA6\uFF0C\u6570\u7EC4\u5177\u6709\u52A8\u6001\u6269\u5BB9\u673A\u5236\u3002</li><li>\u4E0D\u9700\u8981\u9650\u5B9A\u5143\u7D20\u7C7B\u578B\uFF0C\u6570\u7EC4\u5143\u7D20\u652F\u6301\u52A8\u6001\u7C7B\u578B\u3002</li></ul><p>\u5927\u5BB6\u53EF\u80FD\u4F1A\u89C9\u5F97\u8FD9\u662F\u52A8\u6001\u8BED\u8A00\u7684\u7279\u5F81\uFF0C\u4F46\u662F\u5176\u80CC\u540E\u7684\u539F\u7406\u662F\u4EC0\u4E48\u5462\uFF1F</p><p>JavaScript \u7684\u6570\u7EC4\u5206\u4E3A\u5FEB\u6570\u7EC4\u548C\u6162\u6570\u7EC4\uFF0C\u5176\u4E2D\u5FEB\u6570\u7EC4\u662F\u5177\u6709\u52A8\u6001\u6269\u5BB9\u673A\u5236\u7684\u771F\u6B63\u7684\u6570\u7EC4\uFF0C\u5176\u5185\u5B58\u662F\u8FDE\u7EED\u5B58\u50A8\u7684\uFF0C\u8BBF\u95EE\u901F\u5EA6\u8F83\u5FEB\uFF1B\u6162\u6570\u7EC4\u5219\u662F HashMap\uFF0C\u8FD9\u5BF9\u4E8E\u7A00\u758F\u6570\u7EC4\u6BD4\u8F83\u6709\u6548\uFF0C\u8282\u7701\u4E86\u5B58\u50A8\u7A7A\u95F4\uFF0C\u4F46\u662F\u727A\u7272\u4E86\u8BBF\u95EE\u901F\u5EA6\u3002\u5728 Array \u4E2D\uFF0C\u672A\u586B\u5145\u503C\u7684\u5143\u7D20\u79F0\u4E4B\u4E3A Hole\uFF08\u7A7A\u6D1E\uFF09\uFF0C\u6253\u5370\u51FA\u6765\u5F80\u5F80\u662F <code>empty</code> \uFF08\u6CE8\u610F\uFF0C\u4E0D\u662F\u6307 <code>undefined</code> \uFF09\u3002\u5F88\u663E\u7136\uFF0C\u5982\u679C Array \u8F83\u4E3A\u7A00\u758F\uFF0C\u5373 Hole \u6BD4\u8F83\u591A\uFF0C\u4F7F\u7528\u6162\u6570\u7EC4\u6BD4\u8F83\u6709\u6548\u7387\uFF0C\u6BD5\u7ADF\u5185\u5B58\u4EE3\u4EF7\u4E5F\u662F\u6BD4\u8F83\u6602\u8D35\u7684\uFF1B\u53CD\u4E4B\uFF0C\u5F53 Array \u8F83\u4E3A\u7D27\u5BC6\u65F6\uFF0C\u5373 Hole \u6BD4\u8F83\u5C11\uFF0C\u4F7F\u7528\u5FEB\u901F\u7EC4\u5219\u80FD\u591F\u5145\u5206\u53D1\u6325\u6570\u7EC4\u5FEB\u901F\u8BBF\u95EE\u7684\u7279\u6027\u3002V8 \u4E2D\u5F88\u597D\u7684\u5E73\u8861\u4E86\u6570\u7EC4\u4E2D\u7A7A\u95F4\u548C\u65F6\u95F4\u5360\u7528\u7684\u5F00\u9500\uFF0C\u5E2E\u52A9\u6211\u4EEC\u81EA\u52A8\u7684\u8FDB\u884C\u5FEB\u6162\u6570\u7EC4\u7684\u5207\u6362\u3002</p><p>\u6CE8\u610F\uFF0C\u5FEB\u6162\u6570\u7EC4\u7684\u5207\u6362\u662F\u6709\u4E00\u5B9A\u590D\u5236\u5143\u7D20\u7684\u6210\u672C\u7684\uFF0C\u56E0\u6B64\uFF0C\u6211\u4EEC\u5E94\u8BE5\u51CF\u5C11\u8FD9\u79CD\u60C5\u51B5\u9891\u7E41\u5730\u53D1\u751F\u3002</p><p>\u5FEB\u6570\u7EC4\u662F\u5982\u4F55\u5B58\u53D6\u7684\uFF1F\u5FEB\u6570\u7EC4\u53EF\u4EE5\u901A\u8FC7\u4E0B\u6807\u5FEB\u901F\u5B58\u53D6\u3002</p><p>\u6162\u6570\u7EC4\u662F\u5982\u4F55\u5B58\u53D6\u7684\uFF1F\u6162\u6570\u7EC4\u4E2D\u7684\u54C8\u5E0C\u8868\u662F\u901A\u8FC7\u6570\u7EC4\u6A21\u62DF\u7684\u3002\u5728\u5B58\u503C\u65F6\uFF0C\u9996\u5148 key \u503C\u7ECF\u8FC7\u54C8\u5E0C\u5904\u7406\u548C\u4E00\u5B9A\u7684\u53D8\u6362\u673A\u5236\uFF08\u53D6\u4F4E\u4E24\u4F4D\uFF09\u627E\u5230\u8BE5\u5143\u7D20\u7684\u8D77\u59CB\u5B58\u653E\u4F4D\u7F6E\uFF0C\u5982\u679C\u8BE5\u4F4D\u7F6E\u662F\u7A7A\u7684\uFF0C\u5219\u76F4\u63A5\u5B58\u653E\u5728\u8BE5\u4F4D\u7F6E\uFF0C\u5982\u679C\u8BE5\u4F4D\u7F6E\u5DF2\u7ECF\u88AB\u5360\u7528\uFF0C\u5219\u7EE7\u7EED\u5411\u540E\u5BFB\u627E\uFF0C\u76F4\u5230\u627E\u5230\u4E00\u4E2A\u7A7A\u4F4D\u7F6E\u8FDB\u884C\u5B58\u50A8\uFF1B\u5728\u53D6\u503C\u65F6\uFF0C\u540C\u6837\u65B9\u6CD5\u627E\u5230\u8BE5\u5143\u7D20\u7684\u8D77\u59CB\u67E5\u627E\u4F4D\u7F6E\uFF0C\u5339\u914D key \u503C\u5E76\u4E14\u4E0D\u65AD\u5411\u540E\u67E5\u627E\uFF0C\u76F4\u81F3\u627E\u5230\u8BE5\u5143\u7D20\u3002</p></div><h2 id="\u4EC0\u4E48\u662F\u539F\u578B\u94FE\uFF1F" tabindex="-1">\u4EC0\u4E48\u662F\u539F\u578B\u94FE\uFF1F <a class="header-anchor" href="#\u4EC0\u4E48\u662F\u539F\u578B\u94FE\uFF1F" aria-hidden="true">#</a></h2><div class="info custom-block"><p class="custom-block-title">\u6269\u5C55\u95EE\u9898</p><ul><li>\u539F\u578B\u94FE\u7684\u539F\u7406\u662F\u4EC0\u4E48\uFF1F</li><li>V8 \u4E3A\u4EC0\u4E48\u4F7F\u7528\u539F\u578B\u94FE\uFF1F\u76F8\u6BD4\u4E8E OOP \u6709\u4EC0\u4E48\u597D\u5904\uFF1F</li><li>\u539F\u578B\u94FE\u7EE7\u627F\u548C\u666E\u901A\u7EE7\u627F\u6709\u4EC0\u4E48\u4E0D\u540C\uFF1F</li></ul></div><p>\u6BCF\u4E00\u4E2A\u5B9E\u4F8B\u5BF9\u8C61\u4E0A\u6709\u4E00\u4E2A <code>__proto__</code> \u5C5E\u6027\uFF0C\u6307\u5411\u6784\u9020\u51FD\u6570\u7684\u539F\u578B\u5BF9\u8C61\uFF0C\u6784\u9020\u51FD\u6570\u7684\u539F\u578B\u5BF9\u8C61\uFF08prototype\uFF09\u4E5F\u662F\u4E00\u4E2A\u5BF9\u8C61\uFF0C \u4E5F\u6709 <code>__proto__</code> \u5C5E\u6027\uFF0C\u8FD9\u6837\u4E00\u5C42\u4E00\u5C42\u5F80\u4E0A\u627E\u7684\u8FC7\u7A0B\u5C31\u5F62\u6210\u4E86\u539F\u578B\u94FE\u3002</p>`,14),i=[c];function r(l,p,n,d,m,y){return t(),e("div",null,i)}const u=a(s,[["render",r]]);export{v as __pageData,u as default};
